import { useState, useEffect } from 'react';

function Hello() {
	return <h1>Hello</h1>;
}

function App() {
	const [Showing, setShowing] = useState(false);
	const onClick = () => setShowing((prev) => !prev);

	return (
		<div>
			{Showing ? <Hello /> : null}
			<button onClick={onClick}>{Showing ? 'Hide' : 'Show'}</button>
		</div>
	);
}

export default App;
